import React from "react";

export const CountDown = () => {
  const [count, setCount] = React.useState(0);

  React.useEffect(() => {
    const countDown = setInterval(() => {
      setCount(count + 1);
    }, 1000);
    
    return () => clearInterval(countDown);
  });

  return (
    <div>
      <h1>{count}</h1>
    </div>
  );
};
